import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <div className="wrapper">
        <h1>FORM</h1>
        <div className="form-input">
            <input type="text" id="input" placeholder="please input username"/>
            <button type="button" onclick="getInputValue()" id="button">submit</button>
        </div>
        <div id="result">Result:</div>
    </div>
    </div>
  );
}

export default App;
